import { useDrag } from 'react-dnd'
 
export default function Search({ id, name })  {
    const [{ isDragging }, dragRef] = useDrag({
        type: 'pet',
        item: { id, name },
        collect: (monitor) => ({
            isDragging: monitor.isDragging()
        })
    })
    return (
        <div className='pet-card' ref={dragRef}>
            {name}
            {isDragging && 'Oops'}
        </div>
    )
}
